import React, {FC, ChangeEvent } from 'react'
import logo from './images/superAdmin.png';
export default function SuperAdminLogin() {
  function handleOnClick  () {
    var modal = document.getElementById('id01');
window.onclick = function(event) {
  console.log('The link was clicked.'+ modal + "e" + event.target);
    if (event.target == modal) {
        modal.style.display = "none";
    }
}
  }
  return (
     
<div>

<h2 className= "text-center">Super Admin Login Form</h2>

{/* <button className= "selectButton my-3" onClick={handleOnClick} styles="width:auto;" >Login</button> */}

{/* <div id="id01" className="modal"> */}
  
  <form className="modal-content animate" action="/action_page.php" method="post">
    <div className="imgcontainer">
      <span onClick={handleOnClick} className="close" title="Close Modal">&times;</span>
      <img src={logo} alt="Avatar" className="avatar"/>
    </div>

    <div className="container">
      <label htmlFor="uname"><b>Username</b></label><br />
      <input type="password" placeholder="Enter Username" name="uname" required/><br />

      <label htmlFor="psw"><b>Password</b></label><br />
      <input type="password" placeholder="Enter Password" name="psw" required/>
        
      <button type="submit">Login</button>
      <label>
        <input type="checkbox" name="remember" /> Remember me
      </label>
    </div>

    <div className="container" styles ="background-color:#f1f1f1">
      <button type="button" onClick= {handleOnClick} className="cancelbtn">Cancel</button>
      <span className="psw">Forgot <a href="#">password?</a></span>
    </div>
  </form>
</div>

// </div>
    )
}
